import React, { Component } from 'react';


class Todo extends Component {
    constructor(props) {
      super(props);
      this.toDoRemove = this.toDoRemove.bind(this);
    }

    toDoRemove(e) {
      this.props.toDoListRemove(e.target.id);
    }

    render() {
      return React.createElement("li", null, this.props.todo.value, React.createElement("button", {
        id: this.props.todo.id,
        onClick: this.toDoRemove
      }, "Remove"));
    }

  }

  export default Todo
